import './App.css';
import React from "react";
import Header from "./component/Header";
import Navigation from ".component/Navigation";
import MainContent from ".component/MainContent";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header/>
        <Navigation/>
      </header>
      <MainContent/>
    </div>
  );
}

export default App;
